import React from 'react';
import Upload from '../components/Upload';
import ScrollToTop from '../components/ScrollToTop';

function UploadPage() {
  return (
    <React.Fragment>
      <ScrollToTop/>
      <Upload/>
    </React.Fragment>
  );
}

export default UploadPage;
